    true,nt"url": null,nt"notes": "This dataset contains employee compensation
    estimates in thousands of dollars, seasonally adjusted at annual rates.  All dollar
    estimates are in current dollars (not adjusted for inflation).  Compensation is
    the total remuneration, both monetary and in kind, payable by employers to employees
    in return for their work during the period. It consists of wages and salaries and
    of supplements to wages and salaries. Compensation is presented on an accrual basis--that
    is, it reflects compensation liabilities incurred by the employer in a given period
    regardless of when the compensation is actually received by the employee.rnrnrnThe
    estimates of compensation by industry for 1998-2006 are based on the 2002 North
    American Industry Classification System (NAICS). The estimates for 2007-2010 are
    based on the 2007 NAICS. The estimates for 2011 forward are based on the 2012 NAICS.",nt"license_title":
